import React, { Fragment } from "react";
import "./App.css";
import EditTodo from "./components/EditTodo";

//components

import InputTodo from "./components/InputTodo";

function App() {
  return (
    <Fragment>
      <Container fluid>
        <InputTodo />
        <EditTodo/>
      </Container>
    </Fragment>
  );
}

export default App;
